import * as React from "react";
import { Image } from "expo-image";
import { StyleSheet, View, Pressable, Text } from "react-native";
import { useNavigation } from "@react-navigation/native";
import { Border, Color, FontFamily, FontSize } from "../GlobalStyles";

const AndroidSmall1 = () => {
  const navigation = useNavigation();

  return (
    <View style={styles.androidSmall1}>
      <Image
        style={[styles.androidSmall1Child, styles.androidPosition]}
        contentFit="fill"
        source={require("../assets/ellipse-21.png")}
      />
      <Image
        style={styles.undrawAccessAccountRe8spmIcon}
        contentFit="fill"
        source={require("../assets/undraw-access-account-re-8spm-1.png")}
      />
      <Image
        style={[styles.androidSmall1Item, styles.androidPosition]}
        contentFit="fill"
        source={require("../assets/vector-7.png")}
      />
      <View style={styles.androidSmall1Inner} />
      <View style={[styles.rectangleView, styles.rectanglePosition]} />
      <Pressable
        style={[styles.rectanglePressable, styles.rectanglePosition]}
        onPress={() => navigation.navigate("AndroidSmall2")}
      />
      <Text style={styles.login}>{`Login `}</Text>

      <Text
        style={[styles.usernameEmail, styles.usernameEmailTypo]}
      >{`Username , email & phone number`}</Text>
      <Text style={[styles.forgotPassword, styles.usernameEmailTypo]}>
        Forgot Password ?
      </Text>
      <Text style={styles.password}>Password</Text>
      <Text style={styles.loginDetails}>Login Details</Text>

    </View>
  );
};

const styles = StyleSheet.create({
  androidPosition: {
    left: 0,
    position: "relative",
  },
  rectanglePosition: {
    left: 45,
    width: 330,
    borderRadius: Border.br_8xs,
