    height: 201,
    position: "absolute",
    overflow: "hidden",
  },
  androidSmall1Item: {
    top: 540,
    width: 420,
    height: 118,
  },
  androidSmall1Inner: {
    top: 100,
    height: 57,
    width: 330,
    borderRadius: Border.br_8xs,
    left: 16,
    borderWidth: 1,
    borderColor: "#887e7e",
    borderStyle: "solid",
    position: "relative",
  },
  rectangleView: {
    top: 120,
    height: 56,
    borderWidth: 1,
    borderColor: "#887e7e",
